		.org 100h

                .binfile baboon-dissolve.asm
                .download bin
                .tape v06c-rom
                .nodump

		di
		xra	a
		out	10h
		lxi	sp,100h
		mvi	a,0C3h
		sta	0
		lxi	h,Restart
		shld	1

		call	Cls
		mvi	a,0C9h
		sta	38h
		ei
		hlt
		lxi	h, colors+15
colorset:
		mvi	a, 88h
		out	0
		mvi	c, 15
colorset1:	mov	a, c
		out	2
		mov	a, m
		out	0Ch
		dcx	h
		out	0Ch
		out	0Ch
		dcr	c
		out	0Ch
		out	0Ch
		out	0Ch
		jp	colorset1
		mvi	a,255
		out	3


Restart:
		call	Cls
		lxi h,pic
		lxi d,0A000h
MovPic:
		mov a,m
		stax d
		inx h
		inx d
		mov a,d
		ora e
		jnz MovPic
		
loop:
		call rnd16
		call setpixel
counter:		
		lxi h,65535
		dcx h
		mov a,h
		ora l
		shld counter+1
		jnz	loop
		lxi h,0
		call setpixel
neverend:
		jmp neverend

Cls:
		lxi	h,08000h
		xra	a
ClrScr:
		mov	m,a
		inx	h
		cmp	h
		jnz	ClrScr
		ret

;выход:
;HL - число от 1 до 65535
rnd16:
		lxi h,65535
		dad h
		shld rnd16+1
		rnc
		mvi a,00000001b ;перевернул 80h - 10000000b
		xra l
		mov l,a
		mvi a,01101000b	;перевернул 16h - 00010110b
		xra h
		mov h,a
		shld rnd16+1
		ret

;вход:
;H - X
;L - Y
setpixel:
		mov d,h
		mvi a,11111000b
		ana h
		rrc
		rrc
		stc
		rar
		mov h,a
		mvi a,111b
		ana d
		mov d,a
		mvi a,10000000b
		jz setpix1
setpix2:
		rrc
		dcr d
		jnz setpix2
setpix1:
		ora m
		mov m,a
		ret
		

colors:
		.db 0,0,0,0,0,0,0,0
		.db 00000000b,00001001b,00010010b,00011011b,00100100b,00101101b,00110110b,00111111b
		

pic		db64 


		.end
